DROP DATABASE IF EXISTS ProductsDB;

CREATE DATABASE ProductsDB;

USE ProductsDB;

CREATE TABLE IF NOT EXISTS user (
  userId INT NOT NULL PRIMARY KEY AUTO_INCREMENT,
  userName VARCHAR(50) NOT NULL UNIQUE,
  email VARCHAR(255) NOT NULL UNIQUE,
  image VARCHAR(255)
);

CREATE TABLE IF NOT EXISTS category (
  categoryId INT NOT NULL PRIMARY KEY AUTO_INCREMENT,
  name VARCHAR(50) NOT NULL UNIQUE
);

CREATE TABLE IF NOT EXISTS company (
  companyId INT NOT NULL PRIMARY KEY AUTO_INCREMENT,
  name VARCHAR(128) NOT NULL UNIQUE
);

CREATE TABLE IF NOT EXISTS comment (
  commentId INT NOT NULL PRIMARY KEY AUTO_INCREMENT,
  comment TEXT NOT NULL
);

CREATE TABLE IF NOT EXISTS commentImage (
  commentImageId INT NOT NULL PRIMARY KEY AUTO_INCREMENT,
  commentId INT NOT NULL,
  image VARCHAR(255),
  FOREIGN KEY (commentId) REFERENCES comment(commentId) ON UPDATE RESTRICT ON DELETE RESTRICT
);

CREATE TABLE IF NOT EXISTS product (
  productId INT NOT NULL PRIMARY KEY AUTO_INCREMENT,
  name VARCHAR(128) NOT NULL UNIQUE,
  description TEXT,
  categoryId INT NOT NULL,
  companyId INT NOT NULL,
  image VARCHAR(255),
  stock INT NOT NULL DEFAULT 0 CHECK (stock >= 0),
  price DECIMAL(10,2) NOT NULL DEFAULT 0 CHECK (price >= 0),
  FOREIGN KEY (categoryId) REFERENCES category(categoryId) ON UPDATE CASCADE ON DELETE RESTRICT,
  FOREIGN KEY (companyId) REFERENCES company(companyId) ON UPDATE CASCADE ON DELETE RESTRICT
);

CREATE TABLE IF NOT EXISTS productReview (
  productReviewId INT NOT NULL PRIMARY KEY AUTO_INCREMENT,
  productId INT NOT NULL,
  userId INT NOT NULL,
  commentId INT,
  rate DECIMAL(5,2) NOT NULL CHECK (rate BETWEEN 1 AND 5),
  FOREIGN KEY (productId) REFERENCES product(productId) ON UPDATE RESTRICT ON DELETE RESTRICT,
  FOREIGN KEY (userId) REFERENCES user(userId) ON UPDATE RESTRICT ON DELETE RESTRICT,
  FOREIGN KEY (commentId) REFERENCES comment(commentId) ON UPDATE RESTRICT ON DELETE RESTRICT
);






